INSERT INTO `family_log` (`id`, `family_id`, `level`, `text`) VALUES
(1, 1, 0, '13.04.17 23:22 История вашей династии началась! Основатели: Случайновы Елизар и Рената<br>'),
(2, 2, 0, '13.04.17 23:26 История вашей династии началась! Основатели: Иваненко Илиан и Анна<br>'),
(3, 2, 1, '13.04.17 23:32 Новый уровень: 1!<br>Илиан приобретает профессию Размешиватель бетона и зарабатывает 200 р. А его призвание приносит ресурсы: Пластик, резина: 1, Химия, краски: 1<br>   Его жена Анна приобретает профессию Ночной сторож и зарабатывает 225 р. А ее призвание приносит ресурсы: Дерево: 1, Металл: 1<br>Илиан женится на Анна и у них появляются дети 5:<br>Христофор(Получена генная модификация: Рост)<br>Джордан<br>Мефодий<br>Руда<br>Астра<br><br><br>'),
(4, 2, 2, '13.04.17 23:53 Новый уровень: 2!<br>Христофор приобретает профессию Авиамоделлер и зарабатывает 250 р. А его призвание приносит ресурсы: Микроэлектроника: 1, Ткань, кожа, бумага: 1<br>   Его жена Акулина приобретает профессию Лесник и зарабатывает 125 р. А ее призвание приносит ресурсы: Дерево: 1, Ткань, кожа, бумага: 1<br>Джордан приобретает профессию Ночной сторож и зарабатывает 225 р. А его призвание приносит ресурсы: Дерево: 1, Металл: 1<br>   Его жена Таира приобретает профессию Разносчик рекламы и зарабатывает 150 р. А ее призвание приносит ресурсы: Пластик, резина: 1, Микроэлектроника: 1<br>Мефодий приобретает профессию Размешиватель бетона и зарабатывает 200 р. А его призвание приносит ресурсы: Пластик, резина: 1, Химия, краски: 1<br>   Его жена Елизавета приобретает профессию Продавец овощного киоска и зарабатывает 175 р. А ее призвание приносит ресурсы: Микроэлектроника: 1, Химия, краски: 1<br>Христофор женится на Акулина и у них появляются дети 6:<br>Капитон<br>Сила<br>Аким<br>Осип<br>Див<br>Алана<br><br>Джордан женится на Таира и у них появляются дети 1:<br>Сати<br><br>Мефодий женится на Елизавета и у них появляются дети 1:<br>Аркадий<br><br><br>'),
(5, 2, 3, '14.04.17 0:13 Новый уровень: 3!<br>Капитон приобретает профессию Рабочий аэродромной команды и зарабатывает 500 р. А его призвание приносит ресурсы: Микроэлектроника: 2, Ткань, кожа, бумага: 2<br>   Его жена Дора приобретает профессию Промоутер и зарабатывает 350 р. А ее призвание приносит ресурсы: Микроэлектроника: 2, Химия, краски: 2<br>Сила приобретает профессию Лесник и зарабатывает 125 р. А его призвание приносит ресурсы: Дерево: 1, Ткань, кожа, бумага: 1<br>Аким приобретает профессию Рабочий аэродромной команды и зарабатывает 500 р. А его призвание приносит ресурсы: Микроэлектроника: 2, Ткань, кожа, бумага: 2<br>   Его жена Катарина приобретает профессию Продавец овощного киоска и зарабатывает 175 р. А ее призвание приносит ресурсы: Микроэлектроника: 1, Химия, краски: 1<br>Осип приобретает профессию Авиамоделлер и зарабатывает 250 р. А его призвание приносит ресурсы: Микроэлектроника: 1, Ткань, кожа, бумага: 1<br>   Его жена Дарига приобретает профессию Фотограф и зарабатывает 175 р. А ее призвание приносит ресурсы: Дерево: 1, Химия, краски: 1<br>Див приобретает профессию Лесник и зарабатывает 125 р. А его призвание приносит ресурсы: Дерево: 1, Ткань, кожа, бумага: 1<br>   Его жена Габриэлла приобретает профессию Сборщик лома и зарабатывает 175 р. А ее призвание приносит ресурсы: Металл: 1, Химия, краски: 1<br>Аркадий приобретает профессию Столяр и зарабатывает 400 р. А его призвание приносит ресурсы: Пластик, резина: 2, Химия, краски: 2<br>Капитон женится на Дора и у них появляются дети 2:<br>Мариэтта(Получена генная модификация: Тело)<br>Ангел<br><br>Аким женится на Катарина и у них появляются дети 2:<br>Филипп<br>Флора<br><br>Осип женится на Дарига и у них появляются дети 2:<br>Халима<br>Дмитрий<br><br>Див женится на Габриэлла и у них появляются дети 2:<br>Медея<br>Алихан<br><br><br>'),
