(7, 3, 1, '14.04.17 0:26 Новый уровень: 1!<br>Иржи приобретает профессию горничная и зарабатывает 100 р. А его призвание приносит ресурсы: Дерево: 1, Ткань, кожа, бумага: 1<br>   Его жена Арзыгуль приобретает профессию Яростный болельщик и зарабатывает 150 р. А ее призвание приносит ресурсы: Металл: 1, Камень, стекло, керамика: 1<br>Иржи женится на Арзыгуль и у них появляются дети 6:<br>Махмуд(Получена генная модификация: Тип волос)<br>Сармат<br>Шакур<br>Улдуза<br>Аврора<br>Тереза<br><br><br>'),
(8, 3, 2, '14.04.17 0:27 Новый уровень: 2!<br>Махмуд приобретает профессию Яростный болельщик и зарабатывает 150 р. А его призвание приносит ресурсы: Металл: 1, Камень, стекло, керамика: 1<br>   Его жена Астра приобретает профессию Размешиватель бетона и зарабатывает 200 р. А ее призвание приносит ресурсы: Пластик, резина: 1, Химия, краски: 1<br>Сармат приобретает профессию Яростный болельщик и зарабатывает 150 р. А его призвание приносит ресурсы: Металл: 1, Камень, стекло, керамика: 1<br>   Его жена Руда приобретает профессию Размешиватель бетона и зарабатывает 200 р. А ее призвание приносит ресурсы: Пластик, резина: 1, Химия, краски: 1<br>Шакур приобретает профессию официант и зарабатывает 200 р. А его призвание приносит ресурсы: Дерево: 2, Ткань, кожа, бумага: 2<br>Махмуд женится на Астра и у них появляются дети 3:<br>Цезарь<br>Августин<br>Бенедикта<br><br>Сармат женится на Руда и у них появляются дети 2:<br>Яна<br>Рузана<br><br><br>'),
(9, 3, 3, '14.04.17 0:28 Новый уровень: 3!<br>Цезарь приобретает профессию Столяр и зарабатывает 400 р. А его призвание приносит ресурсы: Пластик, резина: 2, Химия, краски: 2<br>   Его жена Сати приобретает профессию Разносчик рекламы и зарабатывает 150 р. А ее призвание приносит ресурсы: Пластик, резина: 1, Микроэлектроника: 1<br>Августин приобретает профессию Столяр и зарабатывает 400 р. А его призвание приносит ресурсы: Пластик, резина: 2, Химия, краски: 2<br>   Его жена Лидия приобретает профессию Продавец овощного киоска и зарабатывает 175 р. А ее призвание приносит ресурсы: Микроэлектроника: 1, Химия, краски: 1<br>Цезарь женится на Сати и у них появляются дети 3:<br>Велор(Получена генная модификация: Тип волос)<br>Александр(Получена генная модификация: Тип волос)<br>Ираклий<br><br>Августин женится на Лидия и у них появляются дети 3:<br>Галим<br>Карина<br>Мирослава<br><br><br>'),
