(12, 4, 2, '14.04.17 16:36 Новый уровень: 2!<br>Ильяр приобретает профессию Валютный трейдер и зарабатывает 450 р. А его призвание приносит ресурсы: Микроэлектроника: 2, Камень, стекло, керамика: 2<br>   Его жена Тереза приобретает профессию официант и зарабатывает 200 р. А ее призвание приносит ресурсы: Дерево: 2, Ткань, кожа, бумага: 2<br>Роман приобретает профессию Рабочий аэродромной команды и зарабатывает 500 р. А его призвание приносит ресурсы: Микроэлектроника: 2, Ткань, кожа, бумага: 2<br>   Его жена Аврора приобретает профессию Яростный болельщик и зарабатывает 150 р. А ее призвание приносит ресурсы: Металл: 1, Камень, стекло, керамика: 1<br>Виссарион приобретает профессию Рабочий аэродромной команды и зарабатывает 500 р. А его призвание приносит ресурсы: Микроэлектроника: 2, Ткань, кожа, бумага: 2<br>   Его жена Улдуза приобретает профессию Яростный болельщик и зарабатывает 150 р. А ее призвание приносит ресурсы: Металл: 1, Камень, стекло, керамика: 1<br>Ильяр женится на Тереза и у них появляются дети 3:<br>Эдуард<br>Рафаил<br>Дебора<br><br>Роман женится на Аврора и у них появляются дети 1:<br>Дамира<br><br>Виссарион женится на Улдуза и у них появляются дети 3:<br>Мичлов<br>Биргит<br>Стелла<br><br>Всего получено: <br> деньги: 1950 р. <br> Дерево: 2,  Металл: 2,  Пластик, резина: 0,  Микроэлектроника: 6,  Ткань, кожа, бумага: 6,  Камень, стекло, керамика: 4,  Химия, краски: 0<br><br>'),
